import React from "react";
import DogCard from "./dogsCard";

const DogsList = ({ dogs }) => {
  return (
    <div>
      {dogs.map((dog) => (
        <DogCard key={dog.id} dog={dog} />
      ))}
    </div>
  );
};

export default DogsList;
